                return node.CreateBindingFailure(CreateDiagnosticInfo(""));
            });

            bindingResult.IsSuccessful.Should().BeTrue();
            bindingResult.Value.RequestUri.ToString().Should().Be("https://httpbin.org/anything");
        }

